column8:
現行型AUDIのR8やA4に代表される、まさに近未来的な表情のLEDポジショニングランプを備えたデビルアイヘッドライトが新登場！もはやヨーロッパのカスタムフリークには大絶賛され、フロントフェイスを一新させる注目のマストアイテムです。専用設計なので取付は純正品と交換するだけで簡単です。（一部加工を必要とする場合あり。）<br><br>●ハロゲンヘッドライト用 ●ウインカー用オレンジバルブ付属 ●LEDポジショニングランプ装備 ●専用ハーネス付属 ●左右セット ●左側通行用（日本光軸仕様） ※オートレベライザー非対応<br><br>【LEDの球切れ、水漏れ（レンズ接合部からの水滴の浸入）に対してご購入されてから1年間完全保証いたします。※保証が適用されるのは製品本体に保証番号の付いたSONAR正規品のみとなりますのでご了承下さい。】<br><br><br>対応車種：98-03 VW ゴルフ4 (1J)<br><br>ランプ、レンズ | ヘッドランプ<br>フォルクスワーゲン | ゴルフ | ゴルフ4 (1J系) <br>※メーカー在庫切れの場合は納期を別途ご案内いたします。<tr><td colspan="2">
